import React from 'react'

const ProjectCardData = (props) => {
  const { logo, count, name, chart } = props.data;

  return (
    <div className='ProjectCard'>
      <div className='ProjectCard__avatar' style={{
        backgroundColor: chart ? ' #e1eeff' : 'none', margin: !chart && 20
      }}>
        <div className='ProjectCard-Logo'>
          <img src={logo} />
        </div>
      </div>
      <div className='ProjectCard-count'>
        <p>{count}</p>
      </div>
      <div className='ProjectCard-status'>
        <p>{name}</p>
      </div>

    </div>
  )
}

export default ProjectCardData;
